          id="demo-simple-select"
          value={props.selectedFiltered}
          label="Age"
          onChange={onSelectHandler}
        >
        {
            props.filterVal.map((val,idx)=>{
                return <MenuItem value={val}>{val}</MenuItem>
            })
        }
        </Select>
      </FormControl>
    </Box>



    </div>
  )
}

export default Filterarea
